import { Box, Stack} from "@material-ui/core";
import { Document, Page } from 'react-pdf/dist/esm/entry.webpack';
import {useState} from 'react';
import resume from "../images/resumeTemp.pdf";




function Resume() {
    const [numPages, setNumPages] = useState(null);
    const [pageNumber, setPageNumber] = useState(1);

    const onDocumentLoadSuccess = ({numPages}) => {
        setNumPages(numPages);
    };

    return (
        <Box className='box' component={Stack} alignItems='center' backgroundColor='red' p={1}  overflow='auto'>
                <Document 
                file={resume}
                onLoadSuccess={onDocumentLoadSuccess}>
                <Page pageNumber={pageNumber}  width={window.innerWidth > 750? window.innerWidth*(2/4) : window.innerWidth*(0.99)} sx={{borderRadius:4}}/>
                </Document>

        </Box>
    )
}


export default Resume;
